import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import { AuthProvider } from './context/AuthContext'; // Adjust path to your AuthContext file
import Header from './components/Header';
import Home from './pages/Home';
import Festival from './pages/Festival'; // Example additional page
import Artists from './pages/Artists';   // Example additional page
import Login from './pages/Login';       // Login page
import AdminPanel from './pages/AdminPanel'; // Admin panel page
import Tickets from './pages/Tickets';   // Tickets page
// Import other pages/components as needed

const App: React.FC = () => (
  <Router>
    <AuthProvider>
      {/* Header is outside Routes so it displays on all pages */}
      <Header />
      <Routes>
        <Route path="/" element={<Home />} />
        <Route path="/festival" element={<Festival />} />
        <Route path="/artists" element={<Artists />} />
        <Route path="/login" element={<Login />} />
        <Route path="/admin" element={<AdminPanel />} />
        <Route path="/tickets" element={<Tickets />} />
        {/* Add other Routes as needed */}
      </Routes>
    </AuthProvider>
  </Router>
);

export default App;
